    w_regBtn_nonClick: function(button, e, eOpts) {
    	var winStore = Ext.getStore('WinStoreNon');
    	var gridRecord = Ext.getCmp('nonGrid').getSelectionModel().getSelection();
    	var flag = '';
    	var msg = '';
    	
		for(var i=0; i<gridRecord.length; i++) {
			if(gridRecord[i].get('REMAIN_AMT') == 0) {
				flag = 'F';
				msg = '전액 처리 된 입금내역입니다.';
			} else if (Ext.getCmp('WN_JAN_AMT').getValue() == 0 ) {
				flag = 'F';
				msg = '입금이 완료된 출하요청입니다.';
			} else {
				if(gridRecord[i].get('V_TYPE') == 'V') {
					gridRecord[i].set('V_TYPE', 'I');
					flag = 'T';
				}
			}
		}
		
		if( flag == 'T') {
			winStore.sync({
				params : {
					V_TYPE : 'BANK',
					U_TYPE : 'SYNC',
					V_COMP_ID : parent.Ext.getCmp('GCOMP_ID').getValue(),
					V_USR_ID : parent.Ext.getCmp('GUSER_ID').getValue(),
	    			V_PRINT_NO: Ext.getCmp('WN_PRINT_NO').getValue(),
	    			V_S_BP_CD: Ext.getCmp('WN_S_BP_CD').getValue(),
	    			V_DN_AMT: Ext.getCmp('WN_TOTAL_AMT').getValue(),
	    			V_JAN_AMT: Ext.getCmp('WN_JAN_AMT').getValue(),
				},
				callback : function(records, operation, success) {
					var res = records.operations[0]._response.responseText;

					if (res.match('Exception')) {
						Ext.Msg.alert('확인', res);
					} else {
						winStore.reload();
						var tbController = S_DN_PAPER.app.getController("TbButtonController");
						tbController.selBtnClick();
						
						Ext.Ajax.request({
							url:'sql/S_DN_PAPER.jsp',
							method: 'post',
							params: {
								V_TYPE: 'BANK',
				    			U_TYPE: 'SH',
				    			V_COMP_ID: parent.Ext.getCmp('GCOMP_ID').getValue(),
				    			V_USR_ID: parent.Ext.getCmp('GUSER_ID').getValue(),
				    			V_PRINT_NO: Ext.getCmp('WN_PRINT_NO').getValue(),
				    			V_S_BP_CD: Ext.getCmp('WN_S_BP_CD').getValue(),
							},
							callback : function(records,operations,success){
							},
						    success : function(response) {
						    	
						    	var jsonResult = Ext.JSON.decode(response.responseText);
								
					 			Ext.getCmp('WN_TOTAL_AMT').setValue(Ext.util.Format.number(jsonResult.resultList[0].DN_LOC_AMT, '0,000'));
					 			Ext.getCmp('WN_JAN_AMT').setValue(Ext.util.Format.number(jsonResult.resultList[0].JAN_AMT, '0,000'));
						    	
						    },
							scope: this
						});
					}
				},
				success : function(response) {
				}
			});
		} else {
			Ext.Msg.alert('확인', msg);
		}
		
    	
    },
 
